import React from 'react';
import ReactDOM from 'react-dom/client';
import "./style.css"

i


const root = ReactDOM.createRoot(document.getElementById('root'));

// Creating Navbar
function Navbar()
{
  return(
    <nav>
      <h1>Perfumy</h1>
      <ul>
        <li>Home |</li>
        <li> Product |</li>
        <li> About |</li>
        <li> Contact Us</li>
      </ul>
    </nav>
  )
}

// Creating Searchbox
function Searchbox()
{
  return(
    <div className="searchbar">
      <input type="text" placeholder="Search" />

    </div>
  )
}

//Creating Products
function Products()
{
  return(
    <div className="products">
      <div class="products">

            <div class="box">

                        <img src="./assets/images/one.jpg"></img>
                        <p>Fogg Wood Extreme, Eau De Parfum, Long-lasting Perfume, 100ml</p>    
            </div>


            <div class="box">
                <img src="./assets/images/three.jpg" alt="villain"></img>
                <p>Fogg Wood Extreme, Eau De Parfum, Long-lasting Perfume, 100ml</p> 
            </div>
            <div class="box">
                <img src="./assets/images/two.jpg" alt="Designs Club"></img>
                <p>Designer Club-Be Spoke by Perfume Lounge Men's Perfume | Premium Long Lasting Perfume</p>
            </div>

        </div>
    </div>
  )
} 

root.render(
  <div>
    <Navbar></Navbar>
    <Searchbox></Searchbox>
    <Products></Products>
  </div>
);
